syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";



import "TowerTeam.proto";

message TowerCurLevelRecord {
	repeated TowerTeam towerTeamList = 13;
	uint32 curLevelIndex = 14;
	repeated uint32 buffIdList = 12;
	bool isUpperPart = 1;
	bool isEmpty = 7;
	uint32 curFloorId = 9;
}
